const Home = () => {
  return (
    
    <>
      <Navbar />
      <HeroSection />
      <SearchSection />
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6 p-6">
      {dummyCars.map((car, index) => (
        <CarCard key={index} car={car} />
      ))}
    </div>
      <FutureSection />
      <Footer />
    </>
  );
};

export default Home;
